import React from 'react';
import './App.css';
import HealthPetal from './images/health.svg';
import WellbeingPetal from './images/wellbeing.svg';
import CulturalPetal from './images/cultural.svg';
import LanguagePetal from './images/language.svg';
import DomesticViolencePetal from './images/domestic-violence.svg';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Harmony Link</h1>
        <p>Helping immigrant women to integrate into their new environment</p>
      </header>
      <main>
        <div className="petal-container">
          <img src={HealthPetal} alt="Health" className="petal" />
          <img src={WellbeingPetal} alt="Well-being" className="petal" />
          <img src={CulturalPetal} alt="Cultural" className="petal" />
          <img src={LanguagePetal} alt="Language Learning" className="petal" />
          <img src={DomesticViolencePetal} alt="Domestic Violence & Cybercrime" className="petal" />
        </div>
        <div className="center-element">
          <input type="text" placeholder="Search..." />
        </div>
      </main>
    </div>
  );
}

export default App;
